description:
First torrent I'm uploading, so not too sure whether it'll work or not.

But this is the fifth album to the amazing Homestuck online comic.

It features the music used in the flash animations to Homestuck.

The songs are at 320kbps.


If you like the songs, buy the album, and show your support to Homestuck and bandcamp! 
